import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Home from './pages/Home'; // ← Import your Home page

function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero/>
      <div className="app-container">
        <Home /> {/* ← Render your homepage here */}
      </div>
    </div>
  );
}

export default App;
